import React from 'react';
import logo from './logo.svg';
import './App.css';

import Navbar from './components/Navbar/Navbar';
import ProfileCard from './components/ProfileCard/ProfileCard';

import useFetch from './hooks/useFetch'

import {PageResponse, ButtonData} from './types/Models'


function App() {
  //let apiData: PageResponse | null = useFetch("https://sandbox.nextleap.app/page/fetch")[0];
  let [apiData] = useFetch("apiData.json");
  if(apiData === null) {
    return (
      <p>
        Loading
      </p>
    )
  }
  let buttonData = apiData!.sideNavigationButtons;

  return (
    <div className="App">
      <Navbar buttonData={buttonData}/>
      <RenderCheck />
    </div>
  );
}

const RenderCheck = () => {
  console.log("Rendered");
  return (
    <p>Comp</p>
  )
}

export default App;
